    showBigImage: function showBigImage(index, list) {
      uni.previewImage({
        current: index,
        urls: list
      });
    },
    onChange: function onChange() {},
    scrolltolower: function scrolltolower() {
      console.log('滚动到底部');
      var that = this;
      that.page++;
      that.requestData();
    },
